import React, { Component } from 'react';
import Book from '../containers/Book';

class ArabicLibrary extends Component {
    render() {
        return (

            <Container>ARABIC BOOKS
                <Book language='dutch' />
            </Container>
        )
    }
}

export default ArabicLibrary;
